const BasicMenu = () => {
    return(
        <div>
            <header>
                <p1>로고</p1>
                <label for="searchMain">검색창</label>
                <input type="text" id="searchMain"></input>
            </header>
            <nav>
                <ul>
                    <li>홈</li>
                    <li></li>
                </ul>
            </nav>
        </div>
    );
}
export default BasicMenu;
